import styled from 'styled-components';
import React from 'react'

const Container = styled.div `
  padding: 20px;
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
`
const Heo = styled.h1 `
    font-size: 45px;
    margin-bottom: 20px;
    font-weight: 500;
`

const Hero = () => {
  return (
    <Container>
        <Heo>Hot Deals for You!</Heo>
    </Container>
  )
}

export default Hero
